import React from 'react';
import {
  Box,
  Typography,
  Paper,
  Card,
  CardContent,
  CardActions,
  Button,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

interface StatCardProps {
  title: string;
  value: string | number;
  description: string;
  link: string;
}

const StatCard: React.FC<StatCardProps> = ({ title, value, description, link }) => {
  const navigate = useNavigate();

  return (
    <Card>
      <CardContent>
        <Typography color="textSecondary" gutterBottom>
          {title}
        </Typography>
        <Typography variant="h4" component="div">
          {value}
        </Typography>
        <Typography variant="body2" color="textSecondary">
          {description}
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small" onClick={() => navigate(link)}>
          View Details
        </Button>
      </CardActions>
    </Card>
  );
};

const Dashboard: React.FC = () => {
  const stats = [
    {
      title: 'Total Tasks',
      value: 24,
      description: 'Active development tasks',
      link: '/development-platform',
    },
    {
      title: 'Resources',
      value: 156,
      description: 'Available resources',
      link: '/resources',
    },
    {
      title: 'Team Members',
      value: 12,
      description: 'Active team members',
      link: '/team',
    },
    {
      title: 'Projects',
      value: 8,
      description: 'Ongoing projects',
      link: '/projects',
    },
  ];

  return (
    <Box>
      <Typography variant="h4" component="h1" gutterBottom>
        Dashboard
      </Typography>
      <Box sx={{ display: 'grid', gridTemplateColumns: { xs: '1fr', sm: '1fr 1fr', md: '1fr 1fr 1fr 1fr' }, gap: 3 }}>
        {stats.map((stat) => (
          <Box key={stat.title}>
            <StatCard {...stat} />
          </Box>
        ))}
      </Box>
    </Box>
  );
};

export default Dashboard;
